<?phpnamespace Rawelja\PasswordGenerator\Tests\Unit;use Rawelja\PasswordGenerator\Facades\PasswordGenerator;;use Rawelja\PasswordGenerator\Tests\TestCase;class PasswordGeneratorTest extends TestCase{    /** @test */    public function weakPasswordTest()    {       $password = PasswordGenerator::type(1)->generate();       $this->assertIsString($password);       $this->assertSame(strlen($password), 6);    }    /** @test */    public function mediumPasswordTest()    {       $password = PasswordGenerator::type(2)->generate();       $this->assertIsString($password);       $this->assertSame(strlen($password), 6);    }    /** @test */    public function strongPasswordTest()    {       $password = PasswordGenerator::type(3)->generate();       $this->assertIsString($password);       $this->assertSame(strlen($password), 6);    }}